import React from 'react'
import "./Skills.css";
import Skills_info from "./Skills_info"
import SkillsCard from './Skills_card';

const Skills = () => {
    return (
        <div className="skills top res_page " id="skills">
            <div className="container">
                <div className='heading'>
                    <h1>Skills</h1>
                </div>

                <div className="skill_content f_flex">
                    <div className="aboutMe">
                        <span className='primary_color'> Hello, </span>
                        <p> My name is is Satyajit Sahoo and I'm a passionate Web Developer using web technologies to build amazing products and focusing on solving problems to enhancing my skills using the power og technology.</p>
                        <p> I will love to hear from you about job opportunity.</p>
                    </div>
                    <div className="d_flex skill_grid">

                        {Skills_info.map((value, index) => {
                            return <SkillsCard
                                name={value.name}
                            />
                        })}

                    </div>
                </div>
            </div>
        </div >
    )
}
export default Skills;
